// A simple ERC20 based security token
// (c) Kallol Borah, 2021

pragma solidity 0.5.7;

import "@openzeppelin/upgrades/contracts/Initializable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/ownership/Ownable.sol";
import "@openzeppelin/contracts-ethereum-package/contracts/token/ERC20/ERC20.sol";

contract Security is Initializable, Ownable, ERC20 {

    string public name;
    string public symbol;

    address preTradeContract;
    address tradeContract;
    address postTradeContract;

    struct registry{
        address transferee;
        address transferor;
        uint256 amount;
        uint256 transferDateTime;
    }

    // mapping security token holders to tokens held
    mapping(address => registry[]) private InstrumentRegistry;

    address[] private holders;

    function initialize(bytes32 _company, bytes32 _isin, address _preTradeContract, address _tradeContract, address _postTradeContract) public initializer {
        Ownable.initialize(msg.sender);
        name = string(abi.encodePacked(_company, _isin));
        symbol = string(abi.encodePacked(_isin));
        preTradeContract = _preTradeContract;
        tradeContract = _tradeContract;
        postTradeContract = _postTradeContract;
    }

    function transferFrom(address _transferor, address _transferee, uint256 _qty) public returns(bool) {
        require(msg.sender==tradeContract || msg.sender==postTradeContract);
        uint size = InstrumentRegistry[_transferee].length;
        InstrumentRegistry[_transferee][size].transferor = _transferor;
        InstrumentRegistry[_transferee][size].transferee = _transferee;
        InstrumentRegistry[_transferee][size].amount = _qty;
        InstrumentRegistry[_transferee][size].transferDateTime = now;
        size = InstrumentRegistry[_transferee].length;
        InstrumentRegistry[_transferor][size].transferor = _transferor;
        InstrumentRegistry[_transferor][size].transferee = _transferee;
        InstrumentRegistry[_transferor][size].amount = _qty;
        InstrumentRegistry[_transferor][size].transferDateTime = now;
        _transfer(_transferor, _transferee, _qty); 
        return true;
    }

    function mint(address _account, uint256 _amount) external {
        require(msg.sender==preTradeContract);
        holders.push(_account);
        uint size = InstrumentRegistry[_account].length;
        InstrumentRegistry[_account][size].transferor = address(this);
        InstrumentRegistry[_account][size].transferee = _account;
        InstrumentRegistry[_account][size].amount = _amount;
        InstrumentRegistry[_account][size].transferDateTime = now;
        return _mint(_account, _amount);
    }

}
